import React from 'react';

export default function Nav() {
    return(
        <nav>
            <h1 className='logo'>GameTracker</h1>

            <div className='signReg'>
                <p className='sign'>Sign In</p>
                <p className='register'>Register</p>
            </div>
            
        </nav>
    )
}
